void testPackUnpack()
{
    int n1 = N;
    int n2 = nm;
    int matrix_len = n1 * n2;
    int b_len = D * matrix_len / 8;
    std::cout << double(D * matrix_len) / 8.0 << "\n";
    uint16_t H[matrix_len];
    uint16_t K[matrix_len];
    uint8_t b[b_len];
    for (int i = 0; i < matrix_len; ++i)
    {
        H[i] = generateRandomNumber(15);
        // H[i] = 0;
        K[i] = 0;
    }
    for (int i = 0; i < b_len; ++i)
    {
        b[i] = 0;
    }

    std::cout << "H_test:" << frodo_hex(H, matrix_len) << "\n\n";

    frodo_pack(H, b, n1, n2);
    std::cout << "b_test:" << frodo_hex(b, b_len) << "\n\n";
    frodo_unpack(K, b, n1, n2);
    std::cout << "K_test:" << frodo_hex(K, matrix_len) << "\n\n";
}

bool testEncodeDecode()
{
    int matrix_len = 8 * 8;
    int b_len = matrix_len * B / 16;
    uint16_t H[matrix_len];
    uint16_t K[matrix_len];
    uint16_t b[b_len], b_e[b_len];
    for (int i = 0; i < matrix_len; ++i)
    {
        H[i] = 0;
        K[i] = 0;
    }
    for (int i = 0; i < b_len; ++i)
    {
        b[i] = generateRandomNumber(16);
        b_e[i] = 0;
    }


    std::cout << frodo_hex(b, b_len) << "\n";
    frodo_encode(K, b);
    std::cout << "K_hex :" << frodo_hex(K, matrix_len) << "\n";
    frodo_decode(K, b_e);

    std::cout << "b_e_hex: " << frodo_hex(b, b_len) << "\n";
    std::cout << "b_e_hex: " << frodo_hex(b_e, b_len) << "\n";
    if (frodo_hex(b, b_len) == frodo_hex(b_e, b_len))
    {
        return 1;
    }
    return 0;
}



